import logo from "./logo.svg";
import "./App.css";

function App() {
  const addTask = () => {
    if (newTask) {
      let num = toDo.length + 1;
      let newEntry = { id: num, title: newTask, status: false };
      setToDo([...toDo, newEntry]);
      setNewTask("");
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <p>TODO List.</p>
        <input type="text" />

        <div>
          <button onClick={addTask}>Add Task</button>
        </div>
      </header>
    </div>
  );
}

export default App;
